rt), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"3028595","type":"CustomJS"},{"attributes":{"fill_color":{"field":"returns_positive","transform":{"id":"3028199"}},"marker":{"value":"inverted_triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_short"}},"id":"3028390","type":"Scatter"},{"attributes":{},"id":"3028480","type":"AllLabels"},{"attributes":{"source":{"id":"3028196"}},"id":"3028439","type":"CDSView"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwP2Dqu1+k1+0//UdIG8X97T8YMytS373tPwflH/Tqp+w/Ez793iSR7T/kBA9KFrvsP+WVjUVRK+w/wbV8m3w+7D/q+Ty90OfsP+WVjUVRK+w/GOamRJAO7D8R8XjR1eHrP7Vcn7BCVes/I7SHNKjB6j8VTRwHghrrPx42V6ViR+s/FU0cB4Ia6z8VjdWod8jqP41q56z1i+s/M0MUnzwN7D/8C253EFzsPz6y2VNibu0/IS/V2F+X7T/MpcdnWBLuP92BtYcIau8/saF1f/488D+xoXV//jzwP7GhdX/+PPA/saF1f/488D+xoXV//jzwP7GhdX/+PPA/saF1f/488D+xoXV//jzwP7GhdX/+PPA/saF1f/488D+xoXV//jzwP7GhdX/+PPA/saF1f/488D+xoXV//jzwP7GhdX/+PPA/saF1f/488D+xoXV//jzwP7GhdX/+PPA/saF1f/488D+xoXV//jzwP7GhdX/+PPA/saF1f/488D/0OwL9mx7wP3L09+FHDfA/rlnFWyIQ8D9ktaHssiLwP9GnOeh3gu8/ySBbBZZE7z/0us6aKbrvPwPApocXdu8/bndfqTib7z+uWcVbIhDwPxiNYFLhsO8/u5+gQwoN8D+GyDafZFrwP92yNfa7RPA/U+LDAJPh7j/WJTPygwDvP6zVpzDAi+8/NNgTJ7dp7z+vlKQ1xkrvPyIUPzXD7u8/3e0U0F9/7z9H5tDseuXvP8rJbBpgSfA/dARirXDf8D+INxNdnNvxP7DIoRlakfE/XJ2fxwhm8T/2iNSZWz
